import {useParams} from "react-router-dom";
import useFetch from "../../../custom-hooks/UseFetch";

export const ProductInfo = () => {

    const { id } = useParams()
    const { products, isLoading} = useFetch()

    return(
        <div className="product-info">
            <h2>Knife info - {id} </h2>
        </div>
    )
}
